import styled from "styled-components";

const Container = styled.div`
  height: 100px;
  width: fit-content;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
  background-color: black;
  color: white;
`;

export function Navbar() {
  return (
    <>
      <Container>
        <h3>UNTITLED</h3>
      </Container>
    </>
  );
}
